import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
///////////////////////////////////////////////////////////////////////////////////////////////////
import Emptycart from "../isLoading/EmptyCart";
import { Box } from "@mui/material";

const Cart = (props) => {
  const dataaa = useSelector((state) => state);

  const data1 = dataaa.user.user.payload;

  console.log(props.allData)//props.allD
  
  //Check id user
  if (data1 !== undefined) {
    const cart = data1.dataUser.cart;
    console.log(cart);
    return (
      <Box style={{ paddingTop: "10em" }}>
        {cart.map((e) => (
          <p>{e.quality}</p>
        ))}
      </Box>
    );
  }

  return (
    <div>
      <Emptycart />
    </div>
  );
};

export default Cart;
